(12045, 9210, 1364, 4, 'Pretty Things', '', '2006-10-09 00:00:00', 0000, 20, 0, 5, '', 'I have developed beauty marks over the years\nI notice them when I''m with you\nA deeper thing that surfaces the more I know myself\nThe more I understand, the more I try\n\nPretty things are what we like to be\nI would like to surrender to beauty\nI am a fool, the kind that everybody wants to be\n''Cause I have you, I am a fool\nI''ve fallen fast and hard because of you\nYou make me feel so beautiful\n\nThe surface of a face is such a surface thing to view\nThe years of life are not enough\nIt doesn''t show the inner part of someone who can laugh\nThe more I know myself, the more I cry\nPretty things are what we want to be\nI would like to surrender to beauty\n\nPretty things are what we like to be\nI would like to surrender to beauty\nI am a fool, the kind that everybody wants to be\n''Cause I have you, I am a fool\nI''ve fallen fast and hard because of you\nYou make me feel so beautiful\n\nPretty things are what we try to be\nI would like to surrender to beauty\n\nPretty things are what we like to be\nI would like to surrender to beauty\nI am a fool, the kind that everybody wants to be\n''Cause I have you, I am a fool\nI''ve fallen fast and hard because of you\nYou make me feel so beautiful\n\n', 297, '', '', '', '', '', '', 0, 1, 0, '2009-01-09 15:22:16', '2015-03-12 13:36:38', '0000-00-00 00:00:00'),
