(12091, 8442, 0, 1, '1937南京大屠殺紀念單曲', '【MV觀賞】http://www.youtube.com/watch?v=RFsURclaVc8\r\n　　\r\n2004年創作，並自費新台幣300萬元，遠赴南京、蘇州拍攝MV，爲全球第一支1937MV，獲中國中央電視台專訪，迄今全球點閱次數逾25,000,000人次。\r\n\r\n*本首歌曲單價99元，將永遠以義賣方式，將款項捐予「台北市婦女救援基金會」與「中國慰安婦問題研究中心」，供其照護兩岸年邁慰安婦之用。\r\n　', '2010-10-27 00:00:00', 0000, 37, 0, 12, '一扁舟　橋下輕滑過\r\n老船工　道盡長江愁\r\n多年後　舊地尋芳蹤\r\n人去樓空　意悠悠\r\n\r\n楓橋過　但見雨花樓\r\n渡江口　傷痛泣訴說\r\n牆垛破　遍地滿瘡孔\r\n化歸塵煙　雨水落\r\n\r\n這些年　我哭過一夜又一夜\r\n舊相片　我翻過一頁又一頁\r\n閉上眼　想起你的從前\r\n這世界　已離我太遙遠\r\n\r\n一轉眼　場景又染紅一整片\r\n望著天　喚不回曾經的誓言\r\n說再見　短短的一瞬間\r\n閉上眼　幸福只剩殘缺\r\n', '', 250, '', '張穆庭', '張穆庭', '江亦帆', '祈年音樂', '', 1, 1, 0, '2009-01-10 01:42:57', '2015-03-12 13:36:40', '0000-00-00 00:00:00'),
(12092, 8442, 0, 1, '全球慰安婦主題曲－－殤', '', '0000-00-00 00:00:00', 0000, 0, 1, 5, '櫻花碎裂我衣裳　淚流臉龐　無力掙扎\r\n看著月亮　想起故鄉　爹娘是否也在窗口望\r\n\r\n花瓣刺入我胸膛　我愛的他　人在何方\r\n永遠的傷　隨風飄蕩　走過半個世紀的堅強\r\n\r\n櫻花遍野　滿山莊　夜黑無盡　淚滄桑\r\n幾許風霜　路漫長　寸斷人惆悵\r\n\r\n不堪回首的過往　我的悲傷　誰能原諒\r\n只能歌唱　傳向遠方　告訴我最深愛的爹娘\r\n\r\n只能歌唱　傳向遠方　告訴我最深愛的爹娘\r\n', '', 318, '', '張穆庭', '張穆庭', '張穆庭', '祈年音樂', '', 0, 0, 1, '2009-01-10 07:56:26', '2013-10-07 17:13:50', '0000-00-00 00:00:00'),
