(12098, 8442, 0, 6, '長城（馮翊綱 / 演唱）', '', '0000-00-00 00:00:00', 0000, 0, 2, 5, '遙望故鄉遠　寒風催思念\r\n長城萬里線　漫天烽火連\r\n\r\n攀山巔　伏冰雪　路蜿蜒　我手揮長鞭向前　不停歇\r\n\r\n看炊煙　飄荒野　聲未竭　心牽　舊家園\r\n糧水缺　物惟艱　忍萬年　終見　天下圓\r\n', '', 268, '', '張穆庭', '張穆庭', '張穆庭', '', '', 0, 0, 1, '2009-01-10 08:52:31', '2013-10-07 17:13:50', '0000-00-00 00:00:00'),
(12099, 8442, 0, 7, '丐幫（黃士偉 / 演唱）', '', '0000-00-00 00:00:00', 0000, 0, 2, 2, '狗棒聲聲響　召集弟兄齊整裝　捲起鋪蓋收拾行囊　走出窮人巷\r\n幫主金身臥前方　手下嘍囉站兩旁　京城地圖攤畫地上　就等號令下\r\n\r\n太祖朱元璋  沿街乞討遊四方　手拿碗缽受盡風霜　看盡天下荒\r\n秀克乞兒遇道長　練成降龍十八掌　懲奸除惡不遑多讓　無愧狀元郎\r\n\r\n哈~\r\n\r\n我　中國丐幫　有錢不住北正房\r\n我　中國丐幫　受人恩澤必還償\r\n我　中國丐幫　行俠仗義江湖闖\r\n我　中國丐幫　民族危難一肩扛\r\n\r\n我　中國丐幫　個人恩怨放兩旁\r\n我　中國丐幫　道義二字掛心上\r\n我　中國丐幫　橫禍飛來有我擋\r\n我　中國丐幫　棧道官兵聞風讓\r\n\r\n我　中國丐幫　中國天下第一幫\r\n', '', 166, '', '張穆庭', '張穆庭', '張穆庭', '', '', 0, 0, 1, '2009-01-10 08:53:53', '2013-10-07 17:13:50', '0000-00-00 00:00:00'),
