(12149, 65, 1420, 1, '重返金銀島', '', '2008-10-17 00:00:00', 0000, 25, 0, 7, '', '作詞：1976\n作曲：1976\n\nLady ocean, how''s everything?\nHaven''t seen you for a while...\nStill i miss your darkness,\nstill i miss your smile\n\n當我脫去船長的制服\n記起還是水手的浪漫\n戴上不再迷惘的眼罩\n寫下新一頁的乘風破浪\n\n\n我們重返金銀島 我們的起點和終點\n分享榮耀和寶藏\n海盜們遺落了地圖 孩子們仍然會造訪\n分享榮耀和寶藏 張開雙臂放肆高聲唱\n\n有時候安靜潾潾波光\n有時候偉大震天巨響\n右舷滿舵要迎向巨浪\n就是讓人畏懼 讓人興奮的海洋', 257, '', '', '', '', '', '', 0, 1, 0, '2009-01-12 15:57:01', '2015-03-12 13:36:41', '0000-00-00 00:00:00'),
