(12151, 65, 1420, 3, '努特', '', '2008-10-17 00:00:00', 0000, 25, 0, 7, '', '作詞：1976\n作曲：1976\n\n沙漠的香料商人 帶著寶藏進來\n城市的領導人們\n正在一起建設我們不會居住的綠洲\n\n* 管你的春天會不會來\n最後的冬天也走了\n努特搬進大城市 嘟嘟嘟 哼著Kraftwerk\n* 管你的春天會不會來\n最後的冬天也走了\n努特搬進大城市 嘟嘟嘟 哼著Kraftwerk\n\n已沒那麼性感 厚重的引擎聲\n仍灰灰的城市裡\n我們一起建設沒有機會居住的綠洲\n\n* 管你的春天會不會來\n最後的冬天也走了\n努特搬進大城市 嘟嘟嘟 哼著Kraftwerk\n* 管你的春天會不會來\n最後的冬天也走了\n努特搬進大城市 嘟嘟嘟 哼著Kraftwerk\n\n他牽著我的手\n我向努特say hello\n他向冬天說了Bye\n春天也一起離開\n他牽著我的手\n我向努特say hello\n他向冬天說了Bye\n春天也一起離開\n\n* 管你的春天會不會來\n最後的冬天也走了\n努特搬進大城市 嘟嘟嘟 哼著Kraftwerk\n* 管你的春天會不會來\n最後的冬天也走了\n努特搬進大城市 嘟嘟嘟 哼著Kraftwerk', 249, '', '', '', '', '', '', 0, 1, 0, '2009-01-12 15:58:05', '2015-03-12 13:36:41', '0000-00-00 00:00:00'),
(12152, 65, 1420, 4, '撒野俱樂部', '', '2008-10-17 00:00:00', 0000, 25, 0, 7, '', '作詞：阿凱\n作曲：阿凱\n\n踢開了路上石塊 把雙手放在口袋\n隨時隨地的遊行 哼著大調歌曲\n嘴巴嚷嚷著憤怒身體誠實的跳舞\n隨時隨地的遊行 爭取無所事事\n\n無所事事的時間 無所事事的權力\nwhat ever we trust\n\nin Clubbing we trust\nin Groove we trust\nin Google we trust\nwhatever we trust\n\nin Clubbing we trust\nin Groove we trust\nin Google we trust\nwhatever we trust\n\n有天變成了被對抗的大人 也別忘記今晚\n我們帶群孩子闖進誰的殿堂\n去撒泡尿\n\n你怎麼會忘記 那些俱樂部男孩\n他們都變成相片 傻傻嵌在這裡\n都還自以為是最初和最終的偶像\n但都不是今晚 也不會是現在\n\n無所事事的時間 無所事事的權力\nwhat ever we trust\n\nin Clubbing we trust\nin Groove we trust\nin Google we trust\nwhatever we trust\n\nin Clubbing we trust\nin Groove we trust\nin Google we trust\nwhatever we trust\n\n有天變成了被對抗的大人 也別忘記今晚\n我們帶群孩子闖進誰的殿堂\n去撒泡尿 去撒撒野\n\n\n間奏\n\n\nin Clubbing we trust\nin Groove we trust\nin Google we trust\nwhatever we trust\n\nin Clubbing we trust\nin Groove we trust\nin Google we trust\nwhatever we trust\n\n\n有天變成了被對抗的大人 也別忘記今晚\n我們帶群孩子闖進誰的殿堂\n去撒撒野\n\n\n有天變成了被對抗的大人 也別忘記今晚\n我們帶群孩子闖進誰的殿堂\n去撒泡尿\n\nwhatever we trust\n\nwhatever we trust\n\nwhatever we trust', 338, '', '', '', '', '', '', 0, 1, 0, '2009-01-12 16:26:47', '2015-03-12 13:36:42', '0000-00-00 00:00:00'),
(12153, 65, 1420, 5, '慶祝節日的戀人', '', '2008-10-17 00:00:00', 0000, 25, 0, 7, '', '作詞：1976\n作曲：1976\n\n忙碌人們穿梭身邊 像是盛裝的一場宴會\n放肆大笑 輕聲細語 此刻的背景音樂\n\n記住今日 記住了你 暈黃卻清楚的永遠\n畫面在說 別管明天 不適合多想的夜\n\n當街燈亮了起來\n我們就飛舞奔跑\n像慶祝節日的戀人\n只有歡笑沒有傷感\n\n揮霍著燦爛的愛和美 說著浪漫的語言\n別管終於要別離的某天\n揮霍著燦爛的愛和美 說著荒唐的語言\n在同一件大衣裡 互相依偎', 358, '', '', '', '', '', '', 0, 1, 0, '2009-01-12 16:27:03', '2015-03-12 13:36:42', '0000-00-00 00:00:00'),
(12154, 65, 1420, 6, '旁白先生', '', '2008-10-17 00:00:00', 0000, 25, 0, 7, '', '旁白先生\n\n作詞：1976\n作曲：1976\n\n你改變了很多你不覺得嗎\n有時候會盡量不這麼想\n畢竟我也很多很多不一樣\n\n很多潤飾的話不覺得厭煩嗎\n有時候會盡量不這麼講\n雖然客客氣氣氣氛很不錯\n至少我這麼想\n\n空氣出現了一道裂縫\n旁白先生的旁白我沒聽過\n陌生味道團團圍住　團團圍住我\n空氣出現了一道裂縫\n旁白先生的旁白不曾需要過\n沒有什麼該怎麼做　該怎麼做什麼\n\n你改變了很多你不覺得嗎\n有時候會盡量不這麼想\n畢竟我也很多很多不一樣\n\n路的盡頭在哪真的重要嗎\n往前疾駛我們只管笑鬧吧\n夕陽西下是他們的方向\nwe''re going no where, yes, why not?\n\n空氣出現了一道裂縫\n旁白先生的旁白我沒聽過\n陌生味道團團圍住　團團圍住我\n空氣出現了一道裂縫\n旁白先生的旁白不曾需要過\n沒有什麼該怎麼做　該怎麼做什麼\n\n也許你是真的想說\n但是我是真的想要躲過\n當你靠近請你請你不要\n不要真說出口\n\n空氣出現了一道裂縫\n旁白先生的旁白我沒聽過\n陌生味道團團圍住　團團圍住我\n空氣出現了一道裂縫\n旁白先生的旁白不曾需要過\n沒有什麼該怎麼做　該怎麼做什麼', 266, '', '', '', '', '', '', 0, 1, 0, '2009-01-12 16:27:14', '2015-03-12 13:36:42', '0000-00-00 00:00:00'),
(12155, 65, 1420, 7, '發光的孩子', '', '2008-10-17 00:00:00', 0000, 25, 0, 7, '', '發光的孩子\n\n作曲：1976\n作詞：陳瑞凱\n\n一開始為什麼總這麼的直接\n當你坐在我最熟悉的位子\n而我忙著提供不錯的笑點\n\n時間他移去臉上一朵朵的花朵\n還會種下一條一條的煩惱\n還會喋喋不休loop不斷從頭\n\n＊你是發光的孩子有我最最想要閃耀的樣子\n總因為美好的事而困惑 I know\n\n就這麼大喇喇的歌頌著青春\n不管是誰的誰的靈魂和身體\n這段片語就會自然而然發著光\n\n＊＊等新的一天開始掛上一點也不靦腆的笑容\n請別說一點也不適合我我還為美好的事而困惑\n\n時間他移去臉上一朵朵的花朵\n還會種下一條一條的煩惱\n還會喋喋不休loop不斷從頭\n\n＊＊等新的一天開始掛上一點也不靦腆的笑容\n請別說一點也不適合我我還為美好的事而困惑\nYeah I''m trying Yeah I''m trying\n\n＊你是發光的孩子有我最最想要閃耀的樣子\n總因為美好的事而困惑 I know\n＊＊等新的一天開始掛上一點也不靦腆的笑容\n請別說一點也不適合我　一點也不適合我\n我還為美好的事而困惑', 238, '', '', '', '', '', '', 0, 1, 0, '2009-01-12 16:27:25', '2015-03-12 13:36:42', '0000-00-00 00:00:00'),
(12156, 65, 1420, 8, '右外野手', '', '2008-10-17 00:00:00', 0000, 25, 0, 7, '', '作曲：1976\n作詞：陳瑞凱\n\n笨拙或者跌跌撞撞那又怎樣\n仍然抓緊飛過的流星\n許下願望　和所有　我認識　的嘻皮一樣\n\n老套或者作白日夢那又怎樣\n仍然反覆出現在眼前\n有個笑容　我記起　記起從前的我\n\nmy heart is full of love\n於是繼續跳舞\nmy heart is full of love\n於是繼續專注\nmy heart is full of love\n於是繼續跳舞\nmy heart is full of love\n\n有個畫面讓我享受今天\n每個假日　每個星期天\n明天繼續站上另外一片相同的草原\n有個畫面讓我享受今天\n每個假日　每個星期天\n明天繼續站上另外一片相同的草原\n\n我連做白日夢都很小人物\n有時候也甚麼都不作\n散一段步\n我想起來畫面\n有一些小雜訊\n有一些不可說\n(my heart is full of love)\n\n有個畫面讓我享受今天\n每個假日　每個星期天\n明天繼續站上另外一片相同的草原\n有個畫面讓我享受今天\n每個假日每個星期天\n明天繼續站上另外一片相同的草原\nHu…\n\n眾人舉起手　派對遠遠進行\n這裡會有個　專注等待的旁觀者\n他們安靜了　剩我拍擊雙手\n這裡不再是　無事昇平的角落\n眾人舉起手　派對遠遠進行\n這裡會有個　專注等待的旁觀者\n他們安靜了', 271, '', '', '', '', '', '', 0, 1, 0, '2009-01-12 16:27:39', '2015-03-12 13:36:42', '0000-00-00 00:00:00'),
