(12166, 3147, 1488, 1, '001 等待', '蘑菇团\r\n2006年蘑菇团的处子秀就象一颗核弹引爆了上海，经过无数演出后，乐队在上海树立了不可撼动的地位，是上海音乐新生代的代表，每次现场演出都有无数乐迷追随。\r\n', '2008-12-05 00:00:00', 0000, 25, 0, 7, '光照进黑色的杯底\r\n残留的LATTE 让星空窒息\r\n影子何时抓得住自己\r\n谁为了权益 背叛了自己 \r\n空白画布要如何落笔\r\n成为难题\r\n装满汗与泪水的容器\r\n承载回忆\r\n\r\n再回首走过的旅途\r\n虽然会抱怨过的辛苦\r\n不到最后我不会服输\r\n我的梦让我不再孤独\r\n\r\n就算我\r\n活的像个土豆\r\n我\r\n还被埋在地下\r\n总有双手会挖出我\r\n\r\n就算我\r\n活的像个土豆\r\n我\r\n还被埋在地下\r\nWaiting for my generation\r\n', '', 166, '蘑菇团', '蘑菇团', '仆仆', 'Jamyam-Yeshe', 'SOMA', '', 1, 1, 0, '2009-01-13 20:25:58', '2015-03-12 13:36:42', '0000-00-00 00:00:00');
